contrato.objetoResumido:
Contratação de empresa especializada para manutenção corretiva com fornecimento de peças para serem substituídas no elevador ELS0371866, instalado no Edifício Aldo Beck. As peças a serem substituídas são:
a) Polia com diâmetro, canais, encaixes, em ferro fundido, conforme projeto mecânico (01 peça);
b) Suporte polia contra peso (01 peça)

O presente contrato tem como objeto a Contratação de empresa especializada para executar serviços de :
- contenção com muro de pedra na Rua Juan Rocha nº338 - Agronômica (lote 01);
- Pavimentação e drenagem na Rua Olga Lacerda - Monte Verde (lote 02);
- Drenagem da Servidão Schimdt - Costeira do Pirajubaé (lote 03);
- Drenagem na Rua Eduardo Nicolichi - Agronômica (lote 04);
- Drenagem da Servidão Costa - Trindade (lote 05).
